import { AppBar, Toolbar, Typography } from "@material-ui/core";
import useStyles from "./styles";

const Navbar = () => {
	const classes = useStyles();
	return (
		<AppBar position="static">
			<Toolbar>
				<Typography variant="h6" className={classes.navLinks}>
					News
				</Typography>
			</Toolbar>
		</AppBar>
	);
};

export default Navbar;
